import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import './Css/animate.css';
import './Css/aos.css';
import './Css/bootstrap.css';
import './Css/button-builder.css';
import './Css/calendar.css';
import './Css/charttist.css';
import './Css/color-1.css';
import  './Css/color-2.css';
import './Css/color-3.css';
import './Css/color-4.css';
import './Css/color-5.css';
import './Css/color-6.css';
import './Css/datatable-extension.css';
import './Css/datatables.css';
import './Css/daterange-picker.css';
import './Css/dropzone.css';
import './Css/feather-icon.css';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
